window.bookSummaryJSON = "The South Seas are a paradise for battle-weary Captain Jack Aubrey and ship's surgeon Stephen Maturin. But their peace is disturbed when Stephen's fancy for a peculiar marine organism lands him overboard. Acting in his usual headstrong fashion, Jack dives into the rescue, unfortunately failing to plan what will happen once they are both in the water watching the sails of the <i>Surprise</i> disappear in the mist."; 
